import React from "react";

function mapImage() {
  return (
    <>
      {/* Image of location/map */}
      <div className="w3-container">
        <img
          src="https://www.w3schools.com/w3css//w3images/map.jpg"
          className="w3-image"
          style={{ width: "100%" }}
        />
      </div>
    </>
  );
}

export default mapImage;
